import styled from 'styled-components';
import { BsArrowClockwise } from 'react-icons/bs';

const Services = () => {
	return <ServicesWrapper>Hello from Services</ServicesWrapper>;
};

export default Services;

const ServicesWrapper = styled.section`
	width: 100%;
	margin: 5rem 0;
	text-align: center;
`;
